import React from 'react';
import MainBackground from './MainBackground.js';

function LoginPage() {
    return (
        <div>
            <MainBackground stage={3} />  // 로그인 페이지에서도 man3.png를 보여주기 위해 stage={3} 설정
            {/* 로그인 폼 구성 요소를 여기에 추가할 예정 */}
        </div>
    );
}

export default LoginPage;
